function parallax(o){this.querySelectorAll(".main__inner .image").forEach(function(e){var a=e.getAttribute("data-speed"),n=(window.innerWidth-o.pageX*a)/100,t=(window.innerWidth-o.pageY*a)/100;e.style.transform="translateX(".concat(n,"px) translateY(").concat(t,"px)")})}$(function(){$(window).scroll(function(){70<$(window).scrollTop()?$(".header").addClass("scroll"):$(".header").removeClass("scroll")}),AOS.init({disable:"mobile",offset:120,delay:0,duration:1e3,easing:"ease-in-out-quad",once:!0})}),document.addEventListener("mousemove",parallax);